import 'package:json_annotation/json_annotation.dart';part 'dic_response.g.dart';@JsonSerializable()class DicRequest {  DicRequest({    this.hobbies,    this.cities,    this.familyStatuses,    this.genders,    this.usrLikeActions,    this.marriagePeriods,    this.chatMsgTypes,    this.chatStatuses,    this.chatSystemMsgs,    this.notificationTypes,    this.ualiRels,  });  List<SecondDic>? hobbies;  List<Dic>? cities;  @JsonKey(name: 'family_statuses')  List<Dic>? familyStatuses;  List<Dic>? genders;  @JsonKey(name: 'usr_like_actions')  List<Dic>? usrLikeActions;  @JsonKey(name: 'marriage_periods')  List<SecondDic>? marriagePeriods;  @JsonKey(name: 'uali_rels')  List<SecondDic>? ualiRels;  @JsonKey(name: 'chat_statuses')  List<SecondDic>? chatStatuses;  @JsonKey(name: 'chat_msg_types')  List<Dic>? chatMsgTypes;  @JsonKey(name: 'chat_system_msgs')  List<SecondDic>? chatSystemMsgs;  @JsonKey(name: 'notification_types')  List<SecondDic>? notificationTypes;  factory DicRequest.fromJson(Map<String, dynamic> json) =>      _$DicRequestFromJson(json);  Map<String, dynamic> toJson() => _$DicRequestToJson(this);}@JsonSerializable()class SecondDic {  SecondDic({    this.id,    this.name,    this.ord,  });  String? id;  String? name;  int? ord;  factory SecondDic.fromJson(Map<String, dynamic> json) =>      _$SecondDicFromJson(json);  Map<String, dynamic> toJson() => _$SecondDicToJson(this);}@JsonSerializable()class Dic {  Dic({    this.id,    this.name,    this.ord,  });  int? id;  String? name;  int? ord;  factory Dic.fromJson(Map<String, dynamic> json) => _$DicFromJson(json);  Map<String, dynamic> toJson() => _$DicToJson(this);}